                      "            writer.addText(o.name)inMode(code)",
                      "",
                      "            for(m.signature) do { part ->",
                      "                writer.addText(part.name)inMode(code)",
                      "                if (part.params.size > 0) then {",
                      "                    writer.addText(\" (\")inMode(code)",
                      "                    for(part.params) do { param ->",
                      "                        if (param.dtype != false) then {",
