                      "                }",
                      "                writer.addText(\")\")inMode(code)",
                      "            }",
                      "",
                      "            if (m.dtype != false) then {",
                      "                writer.addText(\" -> \")inMode(code)",
                      "                if (m.dtype.kind == \"identifier\") then {",
