                      "",
                      "method formatComments(astNode) rowClass (rowClassName) colspan (n) -> String {",
                      "    var t := \"\"",
                      "    if (false != astNode.comments) then {",
                      "        t := t ++ astNode.comments.value ++ \"\\n\"",
                      "    }",
                      "    return t",
                      "}",
